// import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Component } from '@angular/core';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {
  username!: string;
  contactNumber!: string;
  email!: string;
  password!: string;
  confirmPassword!: string;


  constructor(private router:Router){


  }

  signUp(): void {

    this.router.navigateByUrl('/login');

}
}
 <!-- <p>signup works!</p> -->
 <div class="signup">
<div class="signup-container">
    <div class="signup-form">
    <h2 class="signup-heading">Sign Up</h2>
    <div class="form-group">
      <label for="username">Username:</label>
      <input type="text" id="username" [(ngModel)]="username" class="form-control" placeholder="Enter your username">

    </div>
    <div class="form-group">
      <label for="contactNumber">Contact Number:</label>
      <input type="text" id="contactNumber" [(ngModel)]="contactNumber" class="form-control" placeholder="Enter your contact number">
    </div>
    <div class="form-group">
      <label for="email">Email:</label>
      <input type="email" id="email" [(ngModel)]="email" class="form-control" placeholder="Enter your email">
    </div>
    <div class="form-group">
      <label for="password">Password:</label>
      <input type="password" id="password" [(ngModel)]="password" class="form-control" placeholder="Enter your password">
    </div>
    <div class="form-group">
      <label for="confirm-password">Confirm Password:</label>
      <input type="password" id="confirm-password" [(ngModel)]="confirmPassword" class="form-control" placeholder="Confirm your password">
    </div>
    <button class="btn btn-primary" (click)="signUp()">Sign Up</button>
    <div class="login-link">
      <a routerLink="/login">Already have an account? Login here</a>
    </div>

  </div>
</div>
</div>
